INSERT INTO `es_repair` VALUES ('1', '1', '纪委 尹霞', '学校组织参加全省教育系统全面从严治党工作视频会议', '<div id=\"vsb_content_4\">\r\n<p class=\"vsbcontent_start\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4月23日下午，学校在海珠校区英东楼111会议室组织参加省委教育工委召开的2020年全省教育系统全面从严治党工作视频会议。学校领导班子成员、党委委员、纪委委员，二级党组织负责人，全体纪检监察专职干部参加会议。</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;会上，省委教育工委书记、省教育厅党组书记、厅长景李虎总结2019年全省教育系统全面从严治党工作及存在问题，具体部署2020年工作。他指出，2019年，在省委省政府的坚强和正确领导下，全省教育系统扎实有效开展“不忘初心、牢记使命”主题教育，政治建设进一步加强，党建基础不断夯实，政治安全、意识形态安全工作形势平稳向好，党风廉政建设和反腐败斗争不断深化，全面从严治党取得了明显成效，为全省教育事业的改革发展提供了坚强的政治保障。</p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/0/7B/98/70D72F03207A220F2D06632501F_B2A962EC_39145.jpg\" width=\"700\" orisrc=\"/__local/F/7E/98/E6106C3336C0BF5E9FC676AF314_A1665A69_EF0B7.jpg\" vsbhref=\"vurl\" vurl=\"/_vsl/07B9870D72F03207A220F2D06632501F/B2A962EC/39145\" vheight=\"\" vwidth=\"700\"></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;景李虎强调，2020年是决胜全面建成小康社会、决战脱贫攻坚和“十三五”规划收官之年。一要检验政治忠诚，深入学习贯彻习近平新时代中国特色社会主义思想,坚决做到“两个维护”。二要体现政治担当，认真贯彻落实中央文件要求，进一步压实主体责任，推动全面从严治党落实落细。三要体现在推动重点工作和重点任务上，夯实基层党建基础，激发党建活力，推动教育系统基层党建全面进步全面过硬。四要体现在干部队伍建设这个关键任务上，坚持政治标准第一，树立正确用人导向，全面加强领导班子建设。五要体现在阵地建设上，严格落实意识形态工作责任制，强化排查管控，确保校园政治安全和意识形态安全。六要增强斗争精神，敢于较真碰硬、刮骨疗毒，持之以恒正风肃纪反腐，构建一体推进不敢腐不能腐不想腐体制机制，营造风清气正的发展氛围。七要发动群众打一场人民战争、持久战，充分发挥党组织战斗堡垒和党员先锋模范作用，共克时艰，坚决打赢教育系统疫情防控阻击战。</p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/0/33/2F/DB6290200497236F26013D12661_DAC0C82B_48748.jpg\" width=\"700\" orisrc=\"/__local/3/21/77/B514F6F6F1031112C94D8D7FBCE_D1E0984E_27BBA4.jpg\" vsbhref=\"vurl\" vurl=\"/_vsl/0332FDB6290200497236F26013D12661/DAC0C82B/48748\" vheight=\"\" vwidth=\"700\"></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;景李虎对全省教育系统师生复学返校和疫情防控工作进行了再动员、再部署、再强调，确保师生身体健康和校园安全稳定。</p>\r\n<p class=\"vsbcontent_end\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;我校将坚决贯彻落实习近平总书记重要指示批示精神和党中央的决策部署，不折不扣贯彻落实省委省政府的具体工作要求，带领广大党员干部，不忘初心，牢记使命，压实全面从严治党主体责任，以更大的力度、更实的举措，进一步加强学校全面从严治党各项工作，为夺取抗击疫情全面胜利，实现全年教育改革发展目标任务，办好人民满意的教育提供坚强的政治保证和组织保证。</p></div>', '1584708072', '1588488472');
INSERT INTO `es_repair` VALUES ('2', '1', '党委宣传部 田芳', '学校党委理论学习中心组学习贯彻《党委（党组）落实全面从严治党主体责任规定》精神', '<p class=\"vsbcontent_start\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4月24日上午，学校在海珠校区教学楼409会议室召开党委理论学习中心组扩大会议，学习贯彻《党委（党组）落实全面从严治党主体责任规定》精神。学校领导，党委理论学习中心组成员，各二级学院党总支书记参加会议。会议由党委书记宋垚臻主持。</p><p class=\"vsbcontent_img\"> </p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;会上，宋垚臻传达了省委教育工委召开的全省教育系统全面从严治党工作视频会议精神，原原本本、逐章逐条地带领与会人员学习了《党委（党组）落实全面从严治党主体责任规定》。他要求，全校各级党组织、全体领导干部要就全面从严治党工作开展深入的学习思考，重点从三个方面抓好贯彻落实：一是深入学习领会习近平总书记关于全面从严治党的重要论述精神，全面准确把握《党委（党组）落实全面从严治党主体责任规定》的内涵和要求，切实增强做到“两个维护”的政治自觉和责任担当。二是学校党委要通过召开党委常委会、党委全委会专题研究、部署全面从严治党工作；成立全面从严治党工作领导小组，以更大的力度、更实的举措进一步推进学校全面从严治党工作；列出责任清单并开展对照检查，推动各级领导干部落实全面从严治党的主体责任。三是各基层党组织要协助学校党委落实全面从严治党主体责任，一层一层压实责任主体；将全面从严治党工作与本单位实际工作紧密结合，一体谋划、一体贯彻落实；着力形成学校全面从严治党的整体合力，切实以全面从严治党新成效促进学校发展，推进学校治理体系和治理能力的现代化，全力实现学校第五次党代会提出的各项目标任务。</p><p>\r\n\r\n\r\n</p><p class=\"vsbcontent_end\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;会上，党委常委、党委组织部部长黄碧珠，党委常委、党委宣传部统战部部长曾献尼，纪委办公室主任刘兵和机关党委书记廖颖分别结合学习体会和本职工作作交流发言。</p>', '1585126748', '1588488399');
INSERT INTO `es_repair` VALUES ('3', '1', '党委宣传部 龚慧枫', '学校校董、广东恒兴饲料实业股份有限公司董事长陈丹先生向学校捐助2000万元人才引进专项资金', '<div id=\"vsb_content_4\">\r\n<p class=\"vsbcontent_start\">&nbsp; &nbsp; &nbsp; 4月23日，在廖仲恺先生诞辰143周年，建校93周年纪念日之际，学校收到校董、广东恒兴饲料实业股份有限公司董事长陈丹先生捐助的2000万元人民币，成为学校设立人才引进专项资金的首笔捐资。党委书记宋垚臻和校长程萍分别向陈丹校董颁发捐赠证书和接受捐款。</p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \">&nbsp;&nbsp;<img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/9/A7/67/6A2E179EB7393D7D39B5C49A152_DCCE97F2_FD63E.jpg\" width=\"700\" orisrc=\"/__local/9/A7/67/6A2E179EB7393D7D39B5C49A152_DCCE97F2_FD63E.jpg\" vwidth=\"700\" vheight=\"\" vurl=\"/_vsl/9A7676A2E179EB7393D7D39B5C49A152/DCCE97F2/FD63E\" vsbhref=\"vurl\" style=\"float: none; width: 50%;\"></p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/B/7C/EE/F09F89AA8C54762D34E2430DA2F_C67A3C1B_2995B.jpg\" width=\"700\" orisrc=\"/__local/E/EC/27/9391DA96CAD108B9CF28CD7ABD6_3538F35C_11788C.jpg\" vwidth=\"700\" vheight=\"\" vurl=\"/_vsl/B7CEEF09F89AA8C54762D34E2430DA2F/C67A3C1B/2995B\" vsbhref=\"vurl\" style=\"width: 50%;\"></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;国有人才则强，校有人才则兴。一流的师资队伍是高校人才队伍建设的核心任务。近年来，学校坚持“引育并举”，积极推进各项人才工作。2019年学校第五次党代会将“人才强校”明确为今后五年实施的“五大工程”之一。学校近两年以年薪制、新机制等形式先后引进博士129人，进站博士后2人，柔性引进特聘教授等高层次人才4人，珠江学者讲座教授1人。在今年1月3日召开的学校第五次董事会会议上，校董们作出了设立人才引进专项资金，加快提升学校内涵建设水平和综合办学实力的倡议。近日，学校人才队伍建设攻坚战再添喜讯，第二批高层次人才专项事业编制喜获省编办批复。</p>\r\n<p class=\"vsbcontent_end\" style=\"text-align: left;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;此次学校首次设立人才引进专项资金，得到了广大校董的热烈响应。广东恒兴饲料实业股份有限公司董事长、校董陈丹先生率先捐资2000万元人民币，助力学校人才强校战略实施。在4月23日的校企合作系列活动上，陈丹校董受聘为学校创新创业教育校外导师，并代表广东恒兴饲料实业股份有限公司与学校签订校企合作协议，双方将就共建本科生研究生培养基地和教学科研基地、科技联合攻关、科技成果转化等方面开展一系列的深度合作。</p></div>', '1588396603', '1588416382');
INSERT INTO `es_repair` VALUES ('4', '1', '纪委 尹霞', '学校组织参加全省教育系统全面从严治党工作视频会议', '<div id=\"vsb_content_4\">\r\n<p class=\"vsbcontent_start\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4月23日下午，学校在海珠校区英东楼111会议室组织参加省委教育工委召开的2020年全省教育系统全面从严治党工作视频会议。学校领导班子成员、党委委员、纪委委员，二级党组织负责人，全体纪检监察专职干部参加会议。</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;会上，省委教育工委书记、省教育厅党组书记、厅长景李虎总结2019年全省教育系统全面从严治党工作及存在问题，具体部署2020年工作。他指出，2019年，在省委省政府的坚强和正确领导下，全省教育系统扎实有效开展“不忘初心、牢记使命”主题教育，政治建设进一步加强，党建基础不断夯实，政治安全、意识形态安全工作形势平稳向好，党风廉政建设和反腐败斗争不断深化，全面从严治党取得了明显成效，为全省教育事业的改革发展提供了坚强的政治保障。</p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/0/7B/98/70D72F03207A220F2D06632501F_B2A962EC_39145.jpg\" width=\"700\" orisrc=\"/__local/F/7E/98/E6106C3336C0BF5E9FC676AF314_A1665A69_EF0B7.jpg\" vsbhref=\"vurl\" vurl=\"/_vsl/07B9870D72F03207A220F2D06632501F/B2A962EC/39145\" vheight=\"\" vwidth=\"700\" style=\"float: none;\"></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;景李虎强调，2020年是决胜全面建成小康社会、决战脱贫攻坚和“十三五”规划收官之年。一要检验政治忠诚，深入学习贯彻习近平新时代中国特色社会主义思想,坚决做到“两个维护”。二要体现政治担当，认真贯彻落实中央文件要求，进一步压实主体责任，推动全面从严治党落实落细。三要体现在推动重点工作和重点任务上，夯实基层党建基础，激发党建活力，推动教育系统基层党建全面进步全面过硬。四要体现在干部队伍建设这个关键任务上，坚持政治标准第一，树立正确用人导向，全面加强领导班子建设。五要体现在阵地建设上，严格落实意识形态工作责任制，强化排查管控，确保校园政治安全和意识形态安全。六要增强斗争精神，敢于较真碰硬、刮骨疗毒，持之以恒正风肃纪反腐，构建一体推进不敢腐不能腐不想腐体制机制，营造风清气正的发展氛围。七要发动群众打一场人民战争、持久战，充分发挥党组织战斗堡垒和党员先锋模范作用，共克时艰，坚决打赢教育系统疫情防控阻击战。</p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/0/33/2F/DB6290200497236F26013D12661_DAC0C82B_48748.jpg\" width=\"700\" orisrc=\"/__local/3/21/77/B514F6F6F1031112C94D8D7FBCE_D1E0984E_27BBA4.jpg\" vsbhref=\"vurl\" vurl=\"/_vsl/0332FDB6290200497236F26013D12661/DAC0C82B/48748\" vheight=\"\" vwidth=\"700\"></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;景李虎对全省教育系统师生复学返校和疫情防控工作进行了再动员、再部署、再强调，确保师生身体健康和校园安全稳定。</p>\r\n<p class=\"vsbcontent_end\">我校将坚决贯彻落实习近平总书记重要指示批示精神和党中央的决策部署，不折不扣贯彻落实省委省政府的具体工作要求，带领广大党员干部，不忘初心，牢记使命，压实全面从严治党主体责任，以更大的力度、更实的举措，进一步加强学校全面从严治党各项工作，为夺取抗击疫情全面胜利，实现全年教育改革发展目标任务，办好人民满意的教育提供坚强的政治保证和组织保证。</p></div><p>\r\n<br></p><div id=\"div_vote_id\"></div>', '1588487384', '1588487384');
INSERT INTO `es_repair` VALUES ('5', '1', '党政办 杨婧', '程萍校长带队拜访白云区区委、区政府', '<div id=\"vsb_content_4\">\r\n<p class=\"vsbcontent_start\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4月24日上午，程萍校长带队，肖更生、张文峰副校长及白云校区办公室、发展规划处、基建处负责人一行拜访白云区区委、区政府。白云区区委书记赵军明，区委副书记、区长苏小澎，区委常委、钟落潭镇党委书记陈玉云，副区长蔡胜，区委办公室、区教育局、区住房建设交通局、区水务局、区农业农村局负责人参加座谈会。</p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/1/C2/1D/79AC4F1BEC509DF857F462A31CC_712B51B8_37A43.jpg\" width=\"700\" orisrc=\"/__local/0/A9/3E/1215E25BC9E6F57B49D4C8D31C4_26F381C4_A2E95.jpg\" vwidth=\"700\" vheight=\"\" vurl=\"/_vsl/1C21D79AC4F1BEC509DF857F462A31CC/712B51B8/37A43\" vsbhref=\"vurl\"></p>\r\n<p class=\"vsbcontent_end\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;程萍校长对白云区委、区政府一直以来对学校的关心和支持表示衷心感谢，并恳切反映了当前白云校区发展与建设中的困难。赵军明书记表示将一如既往大力支持学校的建设发展。双方就落实解决白云校区配套建设问题进行了会谈，取得务实成果。一是将按照《广州市住房和城乡建设局关于在穗高校政策性住房建设相关问题的会议纪要》落实安排学校周边的幼儿园、中小学建设，并将校区周边广新路的安全系统、排水系统和弱电线路纳入区政工程整治优化；二是提升学校附近医院医疗水平，同时将周边三甲医院建设提上日程，逐步建设综合商业配套；三是租用白云校区第三期未征地作为学校实习农场；四是落实人才公寓租住及教职工优惠购置商品房；五是研究解决改善目前市政道路规划、排洪渠对校园的影响，提升校内水利设施的景观美化。</p></div>', '1588487670', '1588487670');
INSERT INTO `es_repair` VALUES ('6', '1', '纪委 尹霞', '学校纪委召开专职纪检监察干部学习会', '<p class=\"vsbcontent_start\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4月28日下午，学校纪委在808会议室召开专职纪检监察干部学习会。学校党委副书记、纪委书记、监察专员李海燕，学校党委委员、纪委副书记、监察处处长刘兵，全体纪检监察专职干部参加会议。会议由刘兵同志主持。</p><p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/A/BE/8A/C9841E8437544722CC052302B28_4AC77D85_4C377.jpg\" width=\"700\" orisrc=\"/__local/F/DC/BD/3C0E116838F56D252505EEAF9BF_9739E296_286760.jpg\" vsbhref=\"vurl\" vurl=\"/_vsl/ABE8AC9841E8437544722CC052302B28/4AC77D85/4C377\" vheight=\"\" vwidth=\"700\"></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;按广东省纪委监委组织部有关学习要求，大家集中观看了《深入学习贯彻十九届中央纪委四次全会精神》的视频学习资料。学习了《施克辉同志在省纪委常委会第159次（扩大）会议上的讲话摘要》精神。学习部署落实《中央纪委国家监委关于做好失实检举控告澄清工作的意见》有关要求。通报了《关于以某某严重违纪违法案件作为反面典型深入开展警示教育的通知》精神。会议还专题听取和并研究有关案件办理工作情况，提出下一步工作思路。</p><p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/0/42/FD/CB87B842CB4C5531DD1910EB648_16798708_4931A.jpg\" width=\"700\" orisrc=\"/__local/C/36/B9/369DEA1C9065B918E6CC87C6781_EB7E8FAE_28ACF6.jpg\" vsbhref=\"vurl\" vurl=\"/_vsl/042FDCB87B842CB4C5531DD1910EB648/16798708/4931A\" vheight=\"\" vwidth=\"700\"></p><p>&nbsp;&nbsp;&nbsp;&nbsp;李海燕指出，纪检监察干部要持续深入学习十九届中央纪委四次全会精神，把思想和行动统一到习近平总书记重要讲话及全会精神上来，按照省纪委监委工作部署和要求，坚持一体推进不敢腐、不能腐、不想腐这一新时代全面从严治党的重要方略，更加自觉地深化党的自我革命，持续推动全面从严治党向纵深发展。要从反面典型警示教育中汲取深刻教训，坚持“五个摆进去”，联系实际，举一反三，切实加强对干部的教育、管理、监督，努力建设一支让党放心、人民信赖的纪检监察铁军。</p><p>\r\n\r\n\r\n\r\n\r\n</p><p class=\"vsbcontent_end\">&nbsp;&nbsp;&nbsp;&nbsp;大家畅所欲言，谈学习体会讲工作思路，纷纷表示，作为党的纪检监察队伍的一员，要牢记使命，不负韶华，努力做一个忠诚、干净、担当的纪检干部。</p>', '1588487751', '1588487751');
INSERT INTO `es_repair` VALUES ('7', '2', '后勤与资产管理处', '学校召开安全生产工作领导小组扩大会议', '<div id=\"vsb_content_4\">\r\n<p class=\"vsbcontent_start\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;生命至上、安全第一。为进一步学习贯彻习近平总书记关于安全生产工作一系列重要论述精神，部署“五一”劳动节期间疫情防控与安全生产工作，切实做好学生返校复学各项准备事项，学校于4月29日下午在海珠校区召开安全生产工作领导小组扩大会议。校安全生产工作领导小组成员、二级学院主要负责人等参加会议。会议由党委书记宋垚臻同志主持。</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;会上，宋垚臻书记强调，一是要以习近平总书记关于安全生产工作的重要指示批示精神为指引，进一步提高政治站位，始终牢记安全生产这份沉甸甸的责任。每个部门、每位员工都有责任天天讲安全，时刻绷紧安全生产这根弦。二是要加强值班工作，确保“五一”期间校园安全，特别指出要坚决落实值班制，加强宣传教育，做好安全提醒，加强安全检查。三是要继续精心做好学生返校的各项准备工作。要进一步强化底线思维、红线意识，毫不松懈地抓紧抓实抓细疫情防控，把返校复学各项准备工作做得滴水不漏，确保开学后全体师生的生命安全和校园稳定。</p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/3/F9/6F/25A2B41E4CD77E7B800B88828F4_A27075BD_39327.jpg\" width=\"700\" orisrc=\"/__local/9/7E/BA/E5833A549CB8EF504D798BD9C77_7BE9EBAA_1544AA.jpg\" vwidth=\"700\" vheight=\"\" vurl=\"/_vsl/3F96F25A2B41E4CD77E7B800B88828F4/A27075BD/39327\" vsbhref=\"vurl\"></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;程萍校长就疫情防控及开学准备工作提出三点要求：一是要提高政治站位，严格落实安全生产责任。要坚持“党政同责，落实一岗双责，齐抓共管，失职必追责”的原则，毫不松懈抓好假期疫情防控和安全防护各项工作。二是要明确岗位责任，强化落实安全保障措施。各部门、单位要各司其责，强化校园场所、人员、设施设备和各类教育教学活动的安全管理，加大宣传和信息发布，把开学前安全生产排查工作抓紧抓实抓细。三是全力做好迎“五一”及学生返校各项准备工作。要坚持“生命至上，安全第一”原则，把全体师生员工的生命安全和身体健康放在第一位，严格落实请假报备和节日值班制度，确保校园安全稳定。</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;党委常委、副校长张文峰通报了最近一段时间以来中央部委和广东省下发有关安全生产的文件精神及我省今年一季度安全生产工作有关情况，重点传达了《2020年全省教育系统安全生产专项整治方案》《关于做好“五一”劳动节期间新冠肺炎疫情防控和安全稳定工作的通知》主要精神。</p>\r\n<p class=\"vsbcontent_end\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;学生处、实验室与设备管理处、保卫处、基建处和后勤与资产管理处主要负责人就如何做好部门安全生产工作进行了汇报。</p></div>', '1588487872', '1588487872');
INSERT INTO `es_repair` VALUES ('8', '2', '田旭峰', '信息科学与技术学院召开2020年征兵动员会', '<div id=\"vsb_content_4\">\r\n<p class=\"vsbcontent_start\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;为做好征兵宣传工作，让有意向入伍的同学们了解详细的入伍政策和相关信息,4月29日，信息科学与技术学院举办了线上征兵动员会。学院党总支副书记史孔仕、辅导员邓燕桃、田旭峰参加了会议。</p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/D/10/05/CB3ED1FF162378803AA76CFFFBA_B455B19B_51926.png\" width=\"700\" orisrc=\"/__local/D/10/05/CB3ED1FF162378803AA76CFFFBA_B455B19B_51926.png\" vsbhref=\"vurl\" vurl=\"/_vsl/D1005CB3ED1FF162378803AA76CFFFBA/B455B19B/51926\" vheight=\"\" vwidth=\"700\"></p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;会上，八一教官团副团长朱奕莹结合自己入伍的经历，分别从部队介绍、入伍方式、入伍标准、入伍流程、应届毕业生的优势及退伍待遇方面进行了详细的讲解。讲解结束后，与会同学积极提出有关参军入伍的相关问题，几位退伍军人为同学们详细解答，引导同学们保持积极乐观的心态。学院党总支副书记史孔仕向同学们阐述了参加入伍的重要意义，参军入伍可以实现保家卫国、戍守边疆的人生梦想，可以增强爱国主义情怀，可以磨炼出军人意志，养成良好品格和强健体魄；他鼓励广大学子踊跃参军、报效祖国。</p>\r\n<p class=\"vsbcontent_end\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;参军报国，终身无悔。征兵动员会使同学们详细了解了参军入伍的相关政策，激发他们携笔从戎，投身报国的热情。</p></div><p>\r\n<br></p><div id=\"div_vote_id\"></div>', '1588487941', '1588487941');
INSERT INTO `es_repair` VALUES ('9', '2', '基建处', '广州市规划局批复同意我校白云校区修详规', '<div id=\"vsb_content_4\">\r\n<p class=\"vsbcontent_start\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4月29日，广州市规划和自然资源局核发我校《关于同意设计方案审查的复函》（穗规划资源业务函〔2020〕5267号）。根据复函精神，我校此前报送的《白云校区修建性详细规划调整设计方案》获得审核通过，为加快推进白云校区图书信息大楼、行政楼、教学实验楼7-8-9、学生宿舍-4等“提毛工程”项目建设，调整优化校区功能定位奠定了坚实基础。</p>\r\n<p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" style=\"HEIGHT: 718px; WIDTH: 475px\" src=\"https://news.zhku.edu.cn/__local/4/0A/82/135B17190F24B64580402EFF5A5_7045B325_2C5AF.png\" width=\"700\" height=\"990\" orisrc=\"/__local/3/A5/28/4D7A6EF9485005B13670802FC99_9CF84398_1D2869.png\" vwidth=\" 475px\" vheight=\" 718px\" vurl=\"/_vsl/40A82135B17190F24B64580402EFF5A5/7045B325/2C5AF\" vsbhref=\"vurl\"></p></div>', '1588488067', '1588488067');
INSERT INTO `es_repair` VALUES ('10', '3', '科技处', '学校与河源校地合作重大科技成果转化项目启动会在河源市召开', '<p class=\"vsbcontent_start\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4月26日上午，广东省“大专项+任务清单”项目启动会在河源市成功召开。河源市科技局副局长吴仕延、市科技局社会发展与农村科技科科长伍文彬、河源市源城区科学技术局副局长潘晓玲、仲恺农业工程学院轻工食品学院院长王琴以及项目相关单位负责人出席会议。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;由我校轻工食品学院刘袆帆博士牵头申报并主持的“河源板栗及其副产物精深加工关键技术研究与应用推广”项目，以及轻工食品学院马路凯博士参与的由广东中兴绿丰发展有限公司申报的“河源市水果精深加工关键技术研究与产业化应用”项目均获得财政专项100万元资助。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;河源市科技局领导在会上指出，这两个项目均由农村科技特派员承担，项目的顺利立项将有效推动当地特色农产品精深加工，希望各方彼此合作，高效完成考核。项目的顺利立项是我校果蔬加工等相关技术成果在地市转化落地的又一实例，更是我校众多农村科技特派员在地市开展技术对接服务和创新创业的成功案例之一，将有效推动当地相关产业发展，加快我校技术成果在基层的转化落地。</p><p class=\"vsbcontent_end\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;会后，轻工食品学院院长王琴教授在接受河源市电视台的采访中感谢市科技局的信任与支持，将继续做好河源市的科技对接工作。作为农村科技特派员在未来将服务更多企业，加快成果转化，推动地方的相关产业发展。</p><p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/A/70/95/53227C9F4ECBEDF6AC6CEA7377B_4BC8B345_DE7F.jpg\" width=\"700\" orisrc=\"/__local/A/70/95/53227C9F4ECBEDF6AC6CEA7377B_4BC8B345_DE7F.jpg\" vsbhref=\"vurl\" vurl=\"/_vsl/A709553227C9F4ECBEDF6AC6CEA7377B/4BC8B345/DE7F\" vheight=\"\" vwidth=\"700\"></p><p>\r\n\r\n\r\n\r\n\r\n</p><p class=\"vsbcontent_img\" style=\"text-align: center; \"><img class=\"img_vsb_content\" src=\"https://news.zhku.edu.cn/__local/2/60/4C/318D3B695AC4AB166813F38B835_DE65BF3A_8BC88.jpg\" width=\"700\" orisrc=\"/__local/8/6C/34/4C024AA0A76DE36C5E26448DC21_A032F145_75B21F.jpg\" vsbhref=\"vurl\" vurl=\"/_vsl/2604C318D3B695AC4AB166813F38B835/DE65BF3A/8BC88\" vheight=\"\" vwidth=\"700\"></p>', '1588488258', '1588488258');
INSERT INTO `es_repair` VALUES ('11', '1', '吴谦', '【众志成城】我校工商管理学院召开境外师生线上交流会', '<p style=\"padding: 0px; color: rgb(51, 51, 51); font-size: 16px; line-height: 33px; text-indent: 2em;\"><span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">工商管理学院现居境外的老师们分散于不同国家、地区，线上交流会上，大家跨越不同时区，分别介绍了所在国家、地区的防控现状。数据系教授、位于澳大利亚珀斯的吴昌质老师表示，当前，澳洲采取了较为严格的防控措施，当地防控物资较为紧缺，自己主要是居家防控。创新与战略系讲师、位于韩国首尔的詹茜老师表示，目前她在韩国的生活工作一切正常，当地防疫物资供应也逐渐转好。詹老师请学院师生们放心：“我出门必戴口罩，实施各种消毒举措，自己的物资储备也比较齐全。”市场营销系主任张魁峯教授目前在台湾台南，他介绍了台湾的新冠肺炎确诊人数，表示当地疫情防控工作进展较好，自己的线上教学、生活安排都在有序推进中。老师们表示，接下来，将严格对照入境管理规定和防控流程安排好生活、工作，保障好返校前后教学工作的衔接。</span></p><p style=\"padding: 0px; color: rgb(51, 51, 51); font-size: 16px; line-height: 33px;\"><span style=\"padding: 0px; margin: 0px; font-family: 宋体; text-indent: 2em;\">“校党委书记屈哨兵十分牵念、关心大家。你们安好，我们就放心了。” 工商管理学院党委负责人在视频连线中向老师们介绍了学校疫情防控工作的进展情况和相关的管理规定，希望大家将生命安全和身体健康放在首位，多多保重、做好防护，及时与学校、学院沟通信息，继续保持好的状态。</span></p><p style=\"padding: 0px; color: rgb(51, 51, 51); font-size: 16px; line-height: 33px;\"><span style=\"padding: 0px; margin: 0px; font-family: 黑体, SimHei;\"><strong style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px;\">从抗击疫情中汲取力量</span></strong></span></p><p style=\"padding: 0px; color: rgb(51, 51, 51); font-size: 16px; line-height: 33px;\"><span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">自防控新冠肺炎疫情以来，身居境外的工商学子们一直在关注抗疫进展。“我生活上有一定的储备，半个月出门一次，大使馆也有提供援助渠道，各方面状态不错。”在读博士生李晓靖参加了我校与意大利帕多瓦大学的联合培养项目，当前正在帕多瓦。她表示，帕多瓦市的疫情控制状况较好，自己与国内的博导每周联系、正常开展科研。随着中国疫情的好转，中国的抗疫经验也得到了越来越多意大利民众的认可。2018级在读硕士研究生、现在澳大利亚墨尔本的汤晓玲表示，当地防护物品较为匮乏，自己每两周外出采购一次，多数时间居家学习。参与我校联合培养“2+2”本科项目，赴英国卡迪夫大学学习的吴浚桦、李扬、袁奕丰、容懿四位同学中，吴浚桦、李扬已回到国内、正积极配合当地政府实施隔离，仍在英国的袁奕丰、容懿两位同学就储备物资、自我防护的情况进行了汇报。现居韩国首尔、人力162班的高艺娜同学和现居美国加州萨克拉门托的林颖源同学也分别结合当地防控举措讲述了自己的学习生活情况。</span></p><p style=\"padding: 0px; color: rgb(51, 51, 51); font-size: 16px; line-height: 33px;\"><span style=\"padding: 0px; margin: 0px; font-family: 宋体;\">“疫情突如其来，你们每个人都是我们最牵挂的人。”视频连线中，工商管理学院党委传达了校党委对身处境外同学们的关心、挂念，学院领导、辅导员老师等仔细询问了解同学们居家防控、学习生活的状况，在轻松交流的氛围中帮助同学们放松心情，为同学们加油打气，希望身处境外的同学们从国家全民抗疫中汲取精神力量，加强思考、立志向学、担当有为。同学们纷纷表示，自抗击疫情以来，通过各类报道了解了前线医护人员、我校师生等的抗疫行动，深受感动。此次线上交流会传递了关心和暖意，十分感谢学校、学院和老师们的关爱，将继续做好防控，努力学习，力所能及承担社会责任，保持好的状态迎接正式返校。</span></p><div><span style=\"padding: 0px; margin: 0px; font-family: 宋体;\"><br></span></div>', '1588838941', '1588838941');
