-- ----------------------------
-- Table structure for `es_activity`
-- ----------------------------
DROP TABLE IF EXISTS `es_activity`;
CREATE TABLE `es_activity` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `admin_id` int(10) NOT NULL COMMENT '成员姓名',
  `tel` varchar(50) NOT NULL COMMENT '联系方式',
  `community_code` varchar(50) NOT NULL COMMENT '所属小区编号，建议CM开头',
  `building_code` varchar(50) NOT NULL,
  `house_code` varchar(50) NOT NULL COMMENT '房产编号，建议HS开头',
  `title` varchar(255) NOT NULL COMMENT '职业',
  `content` text COMMENT '活动内容',
  `sponsor_unit` varchar(255) NOT NULL COMMENT '举办单位vv',
  `begin_time` int(10) unsigned NOT NULL COMMENT '添加时间',
  `end_time` int(10) unsigned NOT NULL COMMENT '添加时间',
  `status` tinyint(1) DEFAULT '0' COMMENT '审核状态 0 等待审核 1 审核通过 2 审核不通过',
  `reason` varchar(255) DEFAULT NULL,
  `type` tinyint(1) DEFAULT '0' COMMENT '活动类型 0 教学课程 1 学生活动 2 其他',
  `create_time` int(10) unsigned NOT NULL COMMENT '修改时间',
  `update_time` int(10) NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='小区成员信息表';

